window.NAVIGATION_APPS = Object.freeze({
  SKT_MAP: Object.freeze({
    packageName: 'com.skt.tmap.ku',
    iconDataUri: 'data:image/webp;base64,'
  }),
  GODUCK: Object.freeze({
    packageName: 'com.autonavi.minimap',
    iconDataUri: 'data:image/webp;base64,'
  })
});

window.getNavigationAppInfo = function getNavigationAppInfo(packageName) {
  const entries = Object.values(window.NAVIGATION_APPS || {});
  return entries.find((app) => app.packageName === packageName) || null;
};
